import React from 'react'
import cloudy from './img/cloudy.jpg';
import TextField from '@mui/material/TextField';


const WeatherApp = () => {
    return (


        <div className="main-div">
            <h1>My Weather App </h1>
            <center>
                <div className="inputs-and-buttons">
                    <TextField className="input-field" id="standard-basic" label="Enter your country/city . . ." variant="standard" />
                    <p className="countryName">Karachi</p>
                    <p className="date">Tuesday , January 10, 2021</p>

                </div>
            </center>
        </div>

    )
}

// style={{ backgroundImage: `url(${cloudy})` }}

export default WeatherApp
